import React from 'react'
import Product from "../Product"

const Products = ({products}) => {
    return (
        <div>
            <div class="container">
            <Grid>
            {products.map((products)=>{
                return <Product product={products}/>;
            })}
            </Grid>
            </div>
        </div>
    ); 
};

export default Products
